import { Component } from "react";

class HeaderComponent extends Component {
    render() {
        return (
            <header>
                <nav className="navbar">
                    <div>
                        <a>Gym Progress Tracker</a>
                        <ul className="navbar-nav">
                            <li>Home</li>
                            <li>Progress</li>
                        </ul>
                        <ul className="navbar-nav">
                            <li>Login</li>
                            <li>Logout</li>
                        </ul>
                    </div>
                </nav>
            </header>
        );
    }
}

export default HeaderComponent;
